MojKolejnyRobot implements JWRobot {\n\n   // zdefiniowanie pola myMessage do przechowywania \n   // obiektu ErisMessage \n   ErisMessage myMessage = null; \n\n   public void receiveData(ErisMessage message) {\n       // przypisanie obiektu message do pola myMessage \n       // aby m\xF3c skorzysta\u0107 z otrzymanych informacji w \n       // metodzie nextAction() \n       myMessage = message;\n   }\n\n   public JWAction nextAction() {\n       // przechowujemy dwuwymiarowa tablice \n       // wysokosci w zmiennej lokalnej gemMap \n       int [][] gemMap = myMessage.getGemMap(); \n       // odczytujemy dlugosc i szerokosc planszy \n       int width = gemMap.length; \n       int height = gemMap[0].length; \n\n       // odczytujemy pozycje naszego robota \n       int myPositionX = myMessage.getMyPosition().x; \n       int myPositionY = myMessage.getMyPosition().y; \n\n       // inicjalizujemy zmienne w ktorych \n       // zapiszemy wspolrzedne klejnotu \n       int gemPositionX = 0; \n       int gemPositionY = 0; \n\n       // zmienna 'a' przyjmuje wartosci od \n       // zera do szerokosci planszy \n       for (int a = 0; a < width; a++){ \n           // zmienna 'b' przyjmuje wartosci od \n           // zera do wysokosci planszy \n           for (int b = 0; b < height; b++){ \n               // jesli w polu o wspolrzednych  \n               // dlugosc: 'a', szerokosc: 'b' \n               // znajduje sie klejnot \n               if (gemMap[a][b] > 0 ){ \n                       // zapamietaj wspolrzedne \n                       // tego pola \n                       gemPositionX = a; \n                       gemPositionY = b; \n                } \n            }\n        } \n\n       // jesli wspolrzedna X klejnotu wieksza \n       // od wspolrzednej X naszego robota \n       if (gemPositionX > myPositionX )  \n               // idz na wschod \n               return new Move(JWDirection.E); \n\n       // w przeciwnym razie jesli wspolrzedna  \n       // X klejnotu mniejsza od wspolrzednej \n       // X naszego robota \n       else if (gemPositionX < myPositionX ) \n               // idz na zachod \n               return new Move(JWDirection.W); \n\n       // w przeciwnym razie(tzn gdy wspolrzedna X \n       // klejnotu i robota jest rowna) jezeli  \n       // wspolrzedna Y klejnotu wieksza od \n       // wspolrzednej Y robota \n       else if (gemPositionY > myPositionY )  \n               // idz na poludnie \n               return new Move(JWDirection.S); \n\n       // w przeciwnym razie idz na polnoc \n       else return new Move(JWDirection.N); \n\n    } \n}<\/pre>",jk='<pre>package javawars.robots;\n\nimport javawars.ErisMessage;\nimport javawars.JWRobot;\nimport javawars.JWAction;\nimport javawars.JWDirection;\nimport javawars.actions.*;\n\nimport java.util.*;\n\npublic class MojDrugiRobot implements JWRobot {\n\n   public void receiveData(ErisMessage message) {\n       ;\n   }\n\n   public JWAction nextAction() {\n       // tworzenie nowego obiektu java.util.Random \n       Random r = new Random();\n       // losowanie liczby z przedzia\u0142u <0, 4) \n       int losowaLiczba = r.nextInt(4); \n       // je\u015Bli wylosowana liczba jest r\xF3wna zero \n       // robot idzie na p\xF3\u0142noc \n       if (losowaLiczba==0) return new Move(JWDirection.N);\n        // je\u015Bli wylosowana liczba jest r\xF3wna jeden \n       // robot idzie na wsch\xF3d \n       else if (losowaLiczba==1) return new Move(JWDirection.E);\n       // je\u015Bli wylosowana liczba jest r\xF3wna dwa \n       // robot idzie na po\u0142udnie \n       else if (losowaLiczba==2) return new Move(JWDirection.S);\n       // je\u015Bli wylosowana liczba jest r\xF3wna trzy \n       // robot idzie na zach\xF3d \n       else return new Move(JWDirection.W);\n   }\n\n}\n\n<\/pre>',gh='<pre>package javawars.robots;\n\nimport javawars.ErisMessage;\nimport javawars.JWRobot;\nimport javawars.JWAction;\nimport javawars.JWDirection;\nimport javawars.actions.*;\n\nimport java.util.*;\n\npublic class MojKolejnyRobot implements JWRobot {\n\n   // zdefiniowanie pola myMessage do przechowywania \n   // obiektu ErisMessage \n   ErisMessage myMessage = null; \n\n   public void receiveData(ErisMessage message) {\n       // przypisanie obiektu message do pola myMessage \n       // aby m\xF3c skorzysta\u0107 z otrzymanych informacji w \n       // metodzie nextAction() \n       myMessage = message;\n   }\n\n   public JWAction nextAction() {\n       // je\u015Bli wsp\xF3\u0142rz\u0119dna y po\u0142o\u017Cenia robota jest wi\u0119ksza \n       // od zera (tzn robot nie jest przy p\xF3\u0142nocnej granicy \n       // planszy) - robot idzie na p\xF3\u0142noc \n       if (myMessage.getMyPosition().y>0) return new Move(JWDirection.N);\n        // je\u015Bli wsp\xF3\u0142rz\u0119dna x po\u0142o\u017Cenia robota jest wi\u0119ksza \n       // od zera (tzn robot nie jest przy zachodniej granicy \n       // planszy) - robot idzie na zach\xF3d \n       else if (myMessage.getMyPosition().x>0) return new Move(JWDirection.W);\n       // w przeciwnym razie (tzn gdy robot jest w lewym g\xF3rnym \n       // rogu) robot idzie na po\u0142udniowy wsch\xF3d \n       else return new Move(JWDirection.SE);\n   }\n\n}\n\n<\/pre>',sh='<pre>package javawars.robots;\n\nimport javawars.ErisMessage;\nimport javawars.JWRobot;\nimport javawars.JWAction;\nimport javawars.JWDirection;\nimport javawars.actions.*;\n\npublic class MojPierwszyRobot implements JWRobot {\n\n   public void receiveData(ErisMessage message) {\n       ;\n   }\n\n   public JWAction nextAction() {\n       return new Move(JWDirection.N);\n   }\n\n}\n\n<\/pre>',sq="<span class='gems'>",Dq="<span style='font-size: 10px; color: #000;'>",rp="<span style='font-size: 10px; color: #555;'>pokazuj post\u0119p wykonania akcji<\/span>",lj="<span style='margin-left: 10px'>Przegl\u0105daj dost\u0119pne ligi korzystaj\u0105c z menu po lewej stronie<\/span>",Al="<span style='margin-left: 10px'>Utw\xF3rz nowego robota lub ed
